	.globl main
main:

	
	ori	$a3,  $zero,  0
	lw	$a3,  dim($a3) #load matrix dimension in a3
	
	la	$a0,  A
	
	la	$a1,  B
	la	$a2,  C
	# matrix multiplication.
	# leaf procedure
	# inputs in $a0 = x,   $a1 = y,   $a2 = z,   $a3 = n
	# assume that n > 0
	# temporaries used: $s0,  $s1,  $s2 $t0,  $t1,  $t2
	# $s3,   $s4,   $s5,   $s6 as single precision registers
	# constants used:	  zero
	#.text
	
	ori	$s0,  $zero,  0		# i = 0
L1:	ori	$s1,  $zero,  0		# j = 0
L2:	ori	$s2,  $zero,  0		# k = 0
	ori	$s6,  $zero,  0		# z[i][j] = 0.0
	ori	$s7,  $s7,  0
inner:	
	mul	$t0,  $s0,  $a3		# load x[i][k]
	add	$t1,  $t0,  $s2		# i*n+k
	sll	$t1,  $t1,  2		# 4*(i*n+k)
	add	$t2,  $a0,  $t1		# address of x[i][k]
	lw	$s3,  0($t2)		# load x[i][k]
	mul	$t0,  $s2,  $a3		# load y[k][j]
	add	$t1,  $t0,  $s1		# k*n+j
	sll	$t1,  $t1,  2		# 4*(k*n+j)
	add	$t2,  $t1,  $a1		# address of y[k][j]
	lw	$s4,  0($t2)		# load y[k][j]
	mul	$s5,  $s3,  $s4		# x[i][k] * y[k][j]
	add	$s6,  $s6,  $s5	# z[i][j] = z[i][j] + x[i][k]*y[k][j]
	addi	$s2,  $s2,  1		# k++ and test inner loop condition
	bne	$s2,  $a3,  inner	#
	mul	$t0,  $s0,  $a3		# store z[i][j]
	add	$t1,  $t0,  $s1		# i*n+j
	sll	$t1,  $t1,  2		# 4*(i*n+j)
	add	$t2,  $t1,  $a2		# address of z[i][j]
	sw	$s6,  0($t2)		# store z[i][j]
	or	$s7,  $s6,  $zero    #display content of s7 as a result for particular column
	addi	$s1,  $s1,  1		# j++ and test loop condition
	bne	$s1,  $a3,  L2
	
	
	addi	$s0,  $s0,  1		# i++ and test loop condition
	bne	$s0,  $a3,  L1
	ori $s0,  $zero,  1
	ori $s1,  $zero,  2	
